import React from 'react';
import {Link} from 'react-router-dom';

const SubjectList = ({ subjects,onDelete }) => {
    return (
        <div>
            <h2>Subjects</h2>
            <ul>
              {subjects.map(subject => (
                <li key={subject._id}>
                    {subject.name} ({subject.code}) - {subject.credits} credits
                </li>
              ))}
            </ul>
        </div>
    );
};

export default SubjectList;
